import React, { Component } from "react";
import axios from "axios";

import Header from "./Header.js"

import "../css/style.css"

class Webapp extends Component {
    constructor() {
        super();
        this.state = {
            feelings: [],
            boosts: [],
            activities: [],
            feeling: "",
            boosts: "",
            activities: "",
        }
    }

    componentWillMount() {
        axios.get('../data.json')
            .then(res => {
                this.setState({
                    feelings: res.data.feelings,
                    boosts: res.data.boosts,
                    activities: res.data.activities,
                })
            })
            .catch(function (error) {
                console.log(error);
            });
    }

    render() {
        return (
            <div>
                <Header />
                <body>
                    <div className="div1">
                        <div className="selectText">
                            I WANT TO FEEL
                        </div>
                    </div>
                    <div className="div2">
                        <div className="selectText">
                            AND BOOST MY                        
                        </div>                   
                    </div>
                    <div className="div3">
                        <div className="selectText">
                            WHILE I
                        </div>       
                    </div>
                </body>
            </div>
        )
    }
}

export default Webapp;
